import React from "react";
import Grid from '@material-ui/core/Grid';
import "./index.scss";

export const Doubts = () => {
  return (
    <Grid container className="general">
      <Grid item xs={4} className="uno">
        <div className="cuadradoPrimero">
        <p className="TextSubNameTwo">¿Más dudas?</p>
        <Button variant="contained" className="logo">
            Contáctanos
          </Button>
        </div>
      </Grid>
    </Grid>
  );
};
